    const lolo =  await axios
      .get(unidad+`/api/shoping1/numero/`,{
        params:{
          id:id,
          serie:serie,
        }

     })
      .then(res => res.data)
         dispatch({
          type: GET_CARTNDOCU,
          payload: lolo,

          })


    }
      catch(err) {
         dispatch({
          type: GET_CARTNDOCU,
          payload: {}
        })
      }
  }   








export const setNdocufileLoading = () => {
    return {
      type: NDOCUFILE_LOADING
    };
  };

  export const clearCurrentNdocufile = () => {
    return {
      type: CLEAR_CURRENT_NDOCUFILE
